import React from 'react';

function SavedBook(props) {

    return (
  
     <li>
        <div className="container">
            <div className="col">
                    <div className="card">
                        <div className="card-header">
                       saved books
                       </div>
                                            
                          <h1 className="card-body"> 
                        {props.title}
                        
                           </h1>
                           <h2>
                           {props.descrip}
                           </h2>
                       
                    </div>
                </div>
                   </div>
        </li>
    )
}

export default SavedBook
